This species is distinguished from other species in the genus by the following characters: face entirely black (
Fig. 9A
); face roundish in anterior view (
Fig. 9A
); scutellum black; mesopleuron coriaceous, matt, and impunctate; metasoma with second and third tergites reddish (
Fig. 9C
); first metasomal tergite with transverse impression defined (
Fig. 9B
); first metasomal tergite with projections at spiracles or narrow basally (
Fig. 9B
).

Mesoscutum weakly shining, finely granulate, with dense and uniformly strong punctation. Notaulus distinct. Mesopleuron finely punctate, shining in upper part and shagreened in lower part. Metapleuron weakly shining, smooth, with dense punctation. Propodeum weakly rugose (
Fig. 9B
). Area superomedia fused with area basalis, their combined area 2.6 times as long as broad. Costula absent. Area apicalis trapezoidal, 0.6 times as long as broad, and equal to 0.4 of propodeum, often with longitudinal carina and sometimes with striation. Spiracles weakly oval, 1.2 times as long as broad. Hind femur 5.3 times as long as broad. Hind tibia 8.5 times as long as apically broad. First tarsomere of hind leg 8.7 times as long as broad and 2 times as long as second tarsomere. Claws not pectinate. Fore wing with pterostigma elongate, around 5.7 times as long as broad and intercepted by Rs before its middle. 2m-cu curved, with a single bulla. Cu-a slightly inclival, postfurcal. Hind wing with cu-a intercepted around its middle.

Metasoma strongly punctate (
Fig. 9B
). First metasomal tergite 1.1 times as long as apically broad and projecting dorsally, its dorsal longitudinal carinae reaching middle of tergite and with a strong impression between carinae in basal part. Area between dorsal carina and spiracle with longitudinal impression. Spiracles projecting laterally. Subapical impression strong and rather broad. First metasomal sternite 0.2 times as long as its tergite. Second metasomal tergite 0.7 times as long as broad apically (
Fig. 9B
), its transverse impression starting immediately after middle of tergite. Second and third tergite with weak transverse impressions. Ovipositor sheaths weakly cone-shaped (
Fig. 9C
) and as long as height of last visible tergite. Ovipositor stout at base with a shallow subapical notch, tip of upper valve rather elongate after notch, around 0.3 times as long as ovipositor length.

Colouration: body mostly black (
Fig. 9
); apical part of clypeus, fore and middle legs (except coxa), hind femur, base of hind tibia and second and third tergites of metasoma reddish; middle part of hind tibia reddish-yellow.
